const base64SvgAcerto = `data:image/svg+xml;base64,${btoa(svgStringAcerto)}`;

const base64SvgErro = `data:image/svg+xml;base64,${btoa(svgStringErro)}`;

export const AnswerPage = () => {
    const theme = useTheme();
    const navigate = useNavigate();
    const { status } = useParams();

    const goToLevels = () => {
        navigate(`${PATHS.LEVELS}`);
    };

    const isCorrect = useMemo(() => status === "correct", [status]);

    return (
        <DadinhoStack direction="column" height="100%" justifyContent="space-between">
            <DadinhoLogo />
            <DadinhoBox>
                <DadinhoBox
                    sx={{
                        height: '220px',
                        backgroundImage: `url(${isCorrect ? base64SvgAcerto : base64SvgErro})`,
                        backgroundSize: 'auto',
                        backgroundRepeat: 'no-repeat',
                        backgroundPosition: 'center',
                        mb: -7,
                        position: "relative",
                        zIndex: 10,
                    }}
                />
                <DadinhoBox border="2px solid" borderRadius="10px" bgcolor={theme.palette.primary.light} px={3} py={4} pt={6} m={1}>
                    <DadinhoStack direction="column" textAlign="center" spacing={0.5}>
                        <DadinhoTypography variant="h1" fontWeight={theme.typography.fontWeightMedium}>
                            {isCorrect ? "Resposta certa!" : "Resposta errada!"} 
                        </DadinhoTypography>
                        <DadinhoTypography variant="h2" fontWeight={theme.typography.fontWeightLight}>
                            {isCorrect ? "Bora pro prximo nvel!" : "Tenta de novo ;)"} 
                        </DadinhoTypography>
                    </DadinhoStack>
                </DadinhoBox>
                <DadinhoBox display="flex" justifyContent="end" m={1} mt={-2.5}>
                    <DadinhoIconButton onClick={goToLevels}>
                        <EastRoundedIcon />
                    </DadinhoIconButton>
                </DadinhoBox>
            </DadinhoBox>
        </DadinhoStack>
    );
}

export default AnswerPage;